svg.script:
    // 

function status(response) {
  if (response.status >= 200 && response.status < 300) {
    return Promise.resolve(response)
  } else {
    return Promise.reject(new Error(response.statusText))
  }
}

function json(response) {
  return response.json()
}

    function change(layer, evt) {
      var target = document.getElementById(layer);
      var viz = target.getAttribute("opacity");

      if (viz == 0) {
	viz = 1;	
      } else {
        viz = 0;
      }

      target.setAttribute("opacity",viz);
   }
   //

path.onclick:
    document.getElementById('a_layer').setAttribute('opacity', 0);
    document.getElementById('b_layer').setAttribute('opacity', 0);
fetch('https://jsonplaceholder.typicode.com/users')
  .then(status)
  .then(json)
  .then(function(data) {
    console.log('Request succeeded with JSON response', data);
    document.getElementById('a_layer').setAttribute('opacity', 1);

  }).catch(function(error) {
    console.log('Request failed', error);
    document.getElementById('b_layer').setAttribute('opacity', 1);
  });
